import './component.css'

class Body extends Component {
    render(){
        return(
            <div>
            <div className='body'>
                <div className='card-topic'>
                Browse 143+ services provided by our Experts
                </div>
            </div>
            <div className="card">
                    <div className="card-header">
                        <img src="" alt=""/>
                    </div>
                    <div className="card-body">
                        <h2>card</h2>
                        <p>Details</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Body;
